import '../App.css';
import { Button } from './Button';
import './HeroSection.css';
import Skills from './pages/Skills';
// import { useHistory } from 'react';
import {Link } from 'react-router-dom'
import Card from "react-bootstrap/Card";


function HeroSection() {
  // const history = useHistory();
  return (
    <div className='hero-container'>

      <video src='/videos/video-1.mp4' autoPlay loop muted />

      <h1>Software/Web Developer</h1>
      <ul className="courseWork-items">
        <Card style={{ width: "22rem" }}>
        <Card.Body>
          <Card.Title style={{ color: "green" }}>Java OOP I and II</Card.Title>
          <Card.Subtitle className="mb-2 text-muted">
            Concepts of abstraction, encapsulation, inheritance and much more.
          </Card.Subtitle>
          {/* <Card.Text>
            GeeksforGeeks provides a platform for all the students to study
            about all the subjects in CSE.
          </Card.Text> */}

        </Card.Body>
      </Card>
      </ul>
      {/* <p>Learn More About My Expertise</p> */}
      <div className='hero-btns'>
        {/* <Button
          className='btns'
          buttonSize='btn--large'
          component={<Link to = '/skills'>Skills</Link>}

        /> */}



        <Button
          className='btns'
          buttonStyle='btn--primary'
          buttonSize='btn--large'


          // onClick={console.log('hey')}
          component={<Link style={{ color: '#fff',textDecoration: 'none' }} to = '/projects' >Learn More <i className='far fa-play-circle' /></Link>}
        />


      </div>
    </div>
  );
}

export default HeroSection;
